import axios from 'axios';

const TEST_REST_API_URL = 'http://localhost:8080/test/all'
const EXECUTE_TEST_REST_API_URL = 'http://localhost:8080/test/'

class TestService {

    getTests(){
        return axios.get(TEST_REST_API_URL)
    }

    executeTest(name, id) {
        return axios.push(EXECUTE_TEST_REST_API_URL);
    }


}

export default new TestService()
